import "./Navigation.css";

const Navigation = () => {
    return (
        <nav>
            <a href="#" className="item">Оставить отзыв</a>
            <a href="#" className="item">Найти работу</a>
            <a href="#" className="item">Акции</a>
            <a href="#" className="item">Справка</a>
            <a href="#">Русский</a>
            <a href="#" className="item">Войти</a>
        </nav>
    );
}

export default Navigation;
